import React, {Component } from 'react';
import {Link} from 'react-router-dom';
import photo from 'images/download.jpg';
class Cards extends Component {
 
  
    constructor(props) {
        super(props)
        this.state = {
            userId:this.props.data.userId,
            title: this.props.data.title,
         
          }
      }
    render() {
    console.console.log(this.props.product);
    return(
        
        <div className="row">
            <div className="col s12 m12">
                <div className="card">
                    <div className="card-image">
                        <img src={photo}>
                        </img>
                            <span className="card-title">{this.state.userId}</span>
                                   
                                    <div className="card-action">
                                    <Link to={{pathname: '/CoursesContent',state: {title: this.state.title,userId:this.state.userId,Agents:this.props.data} }}>Click Me</Link>
                                            <div class="card-content">
                                            
                                            </div>
                                    </div>
                    </div>
                </div>
            </div>
        </div>
    )
  }
}

export default Cards;
